import React, { useState } from 'react';
import './PatientProfile.css';

const PatientProfile = () => {
  const patient = {
    name: 'Nguyễn Văn A',
    id: '123456789',
    gender: 'Nam',
    birthday: '01/01/1990',
    phone: '0123456789',
    email: 'example@example.com',
    records: [
      'Ghi chú 1',
      'Ghi chú 2',
      'Ghi chú 3',
      'Ghi chú 4',
      'Ghi chú 5',
      'Ghi chú 6',
      'Ghi chú 7',
      'Ghi chú 8',
      'Ghi chú 9',
      'Ghi chú 10',
      'Ghi chú 11',
      'Ghi chú 12',
      'Ghi chú 13',
      'Ghi chú 14',
      'Ghi chú 15',
      'Ghi chú 16',
      'Ghi chú 17',
      'Ghi chú 18',
      'Ghi chú 19',
      'Ghi chú 20',
    ],
  };

  const pageSize = 5; // Kích thước trang
  const [currentPage, setCurrentPage] = useState(1);

  // Tính toán số trang
  const totalPages = Math.ceil(patient.records.length / pageSize);

  // Lấy danh sách hồ sơ bệnh hiện tại dựa trên trang hiện tại
  const startIndex = (currentPage - 1) * pageSize;
  const endIndex = startIndex + pageSize;
  const currentRecords = patient.records.slice(startIndex, endIndex);

  // Chuyển đến trang trước đó
  const goToPreviousPage = () => {
    setCurrentPage((prevPage) => prevPage - 1);
  };

  // Chuyển đến trang tiếp theo
  const goToNextPage = () => {
    setCurrentPage((prevPage) => prevPage + 1);
  };

  // Chuyển đến trang đầu tiên
  const goToFirstPage = () => {
    setCurrentPage(1);
  };

  // Chuyển đến trang cuối cùng
  const goToLastPage = () => {
    setCurrentPage(totalPages);
  };

  return (
    <div className="patient-profile">
      <h2>Thông tin bệnh nhân</h2>
      <div className="info-item">
        <span className="label">Họ tên:</span>
        <span className="value">{patient.name}</span>
      </div>
      <div className="info-item">
        <span className="label">Số chứng minh:</span>
        <span className="value">{patient.id}</span>
      </div>
      <div className="info-item">
        <span className="label">Giới tính:</span>
        <span className="value">{patient.gender}</span>
      </div>
      <div className="info-item">
        <span className="label">Ngày sinh:</span>
        <span className="value">{patient.birthday}</span>
      </div>
      <div className="info-item">
        <span className="label">Số điện thoại:</span>
        <span className="value">{patient.phone}</span>
      </div>
      <div className="info-item">
        <span className="label">Email:</span>
        <span className="value">{patient.email}</span>
      </div>
      <div className="records">
        <h3>Hồ sơ bệnh</h3>
        <ul>
          {currentRecords.map((record, index) => (
            <li key={index}>{record}</li>
          ))}
        </ul>
      </div>
      <div className="pagination">
        <button
          className="pagination-button"
          onClick={goToFirstPage}
          disabled={currentPage === 1}
        >
          &lt;&lt;
        </button>
        <button
          className="pagination-button"
          onClick={goToPreviousPage}
          disabled={currentPage === 1}
        >
          &lt;
        </button>
        {Array.from({ length: totalPages }, (_, index) => index + 1).map(
          (page) => (
            <button
              key={page}
              className={`pagination-button ${currentPage === page ? 'active' : ''}`}
              onClick={() => setCurrentPage(page)}
            >
              {page}
            </button>
          )
        )}
        <button
          className="pagination-button"
          onClick={goToNextPage}
          disabled={currentPage === totalPages}
        >
          &gt;
        </button>
        <button
          className="pagination-button"
          onClick={goToLastPage}
          disabled={currentPage === totalPages}
        >
          &gt;&gt;
        </button>
      </div>
    </div>
  );
};

export default PatientProfile;
